   * @param value 缩放比例
   */
  const _changeMultipleValue = (value) => {
    if ((value > 0 && multipleRef.value >= 5) || (value < 0 && multipleRef.value <= 0.5)) {
      return;
    }
    multipleRef.value += value;
  };
  /**
   * 旋转图片
   * @param angle 旋转角度
   */
  const _changeAngle = (angle) => {
    angleRef.value += angle;
  };

  const _getImageSize = (url: string): Promise<{ width: number; height: number }> => {
    return new Promise((resolve, reject) => {
      let image = new Image();
      image.src = url;
      image.onload = function () {
        let width, height;
        if (image.width > window.innerWidth) {
          width = Math.round(window.innerWidth * 0.8);
          height = Math.round((image.height * window.innerWidth * 0.8) / image.width);
        } else if (image.height > window.innerHeight) {
          width = Math.round((image.width * window.innerHeight * 0.8) / window.innerWidth);
          height = Math.round(window.innerHeight * 0.8);
        } else {
          width = image.width;
          height = image.height;
        }
        resolve({ width, height });
      };
      image.onerror = function (error) {
        reject(error);
      };
    });
  };

  const _bindToggleVisible = () => {
    emit('update:visible', !props.visible);
  };
  const _bindChangeImage = (index) => {
    multipleRef.value = 1;
    _getImageSize(props.list[index].src).then(({ width, height }) => {
      imgWidth.value = width;
      imgHeight.value = height;
    });
    emit('update:image', props.list[index]);
  };
  const _bindResetImage = () => {
    multipleRef.value = 1;
    moveXRef.value = 0;
    moveYRef.value = 0;
    angleRef.value = 0;
    originX = originY = 0;
  };
  /**
   * 鼠标滚轮处理
   * @param event
   */
  const _bindWheelScroll = (event) => {
    event.preventDefault();
    const delta = event.deltaY || event.wheelDelta;
    if (delta > 0) {
      _changeMultipleValue(0.1);
    } else if (delta < 0) {
      _changeMultipleValue(-0.1);
    }
  };

  const _bindMouseEvent = (e: MouseEvent) => {
    switch (e.type) {
      case 'mousedown':
        clientXRef.value = e.clientX;
        clientYRef.value = e.clientY;
        containerEl.value?.addEventListener('mousemove', _bindMouseEvent);
        break;
      case 'mousemove':
        let distanceX = e.clientX - clientXRef.value;
        let distanceY = e.clientY - clientYRef.value;
        moveXRef.value = originX + distanceX;
        moveYRef.value = originY + distanceY;
        break;
      case 'mouseup':
        containerEl.value?.removeEventListener('mousemove', _bindMouseEvent);
        originX = unref(moveXRef);
        originY = unref(moveYRef);
        break;
    }
  };
  // #endregion

  // #region 生命周期

  watch(
    () => props.visible,
    async (val) => {
      // 将图片重置
      _bindResetImage();
      // 计算图片大小
      _getImageSize(props.image?.src || '').then(({ width, height }) => {
        imgWidth.value = width;
        imgHeight.value = height;
      });
      await nextTick();
      let _dom = document.getElementById('image-preview-container');
      if (val) {
        console.log('显示');
        _dom?.addEventListener('mousewheel', _bindWheelScroll);
        // 火狐浏览器没有onmousewheel事件，用DOMMouseScroll代替(滚轮事件)
        document.body.addEventListener('DOMMouseScroll', _bindWheelScroll);
        //  禁止火狐浏览器下拖拽图片的默认事件
        document.ondragstart = function () {
          return false;
        };
      } else {
        console.log('不显示');
        _dom?.removeEventListener('mousewheel', _bindWheelScroll);
        // 移除火狐浏览器下的鼠标滚动事件
        document.body.removeEventListener('DOMMouseScroll', _bindWheelScroll);
        //恢复火狐及Safari浏览器下的图片拖拽
        document.ondragstart = null;
      }
    }
  );
  watchEffect(
    () => {
      current.value = props.list.findIndex((item) => item.src == props.image?.src);
      // console.log('当前预览图索引', current.value);
    },
    { flush: 'post' }
  );
  // #endregion
</script>
